import React from 'react'
import { Provider } from 'react-redux';
import store from '../components/store/store'
import NavBar from '../components/NavBar';


const signup = () => {
    return (
        <Provider store = {store}>
        <NavBar></NavBar>
        </Provider>
    )
}

export default signup
